  Future<Map<String, dynamic>> getGermanyStudentVisaInfo() async {
    String url =
        'https://visalist.io/api/visa-requirements?passenger=IN&destination=DE&visa=student';

    http.Response response = await http.get(Uri.parse(url));
    if (response.statusCode == 200) {
      Map<String, dynamic> data = jsonDecode(response.body);
      List<dynamic> requirements = data['data'][0]['requirements'];
      Map<String, dynamic> result = {'visaType': 'student'};
      for (var item in requirements) {
        result[item['category']] = item['value'];
      }
      return result;
    } else {
      throw Exception('Failed to get Germany student visa information');
    }
  }

