            "adviceDate": "2022-09-07T22:00:00Z",
            "advice":
                "We've reviewed our advice for Belarus. We haven't changed the level of our advice. Do not travel to Belarus due to the volatile security environment caused by the Russian military presence along Belarus' border with Ukraine and military conflict. Russian forces are conducting military operations from Belarus, which has heightened regional tensions. The security environment is volatile and could deteriorate at short notice. Do not attempt to travel to the Belarus-Ukraine border or cross into Ukraine from Belarus. We continue to advise do not travel near borders with Latvia, Lithuania and Poland due to ongoing civil unrest and potential for armed violence.\n\r\n\r\nIf you‚Äôre in Belarus, leave immediately using limited commercial options available or private means.  Review your personal security plans and carefully consider the safest means and route to depart. You‚Äôre responsible for your own safety and that of your family. Travel restrictions due to COVID-19 have been lifted. If you travel to Belarus despite our advice, you no longer need to present a negative COVID-19 (PCR) test result or vaccination certificate to enter the country. You may be affected by shortages of essential products and services.\n\r\n\r\nOur ability to provide consular assistance in Belarus is severely limited. The Australian Government will not be able to evacuate you from Belarus. If you have significant concerns for your welfare, or that of another Australian, contact the Consular Emergency Centre on 1300 555 135 in Australia or +61 2 6261 3305 outside Australia. If you‚Äôre in Belarus, register with the Department of Foreign Affairs and Trade's registration portal for Australian citizens in Belarus ‚Äì see the 'Safety' section for details on how to register.\n\nWe continue to advise:\nDo not travel to Belarus due to the volatile security environment caused by the Russian military presence along Belarus' border with Ukraine and military conflict.",
