            "advice":
                "If you are arriving in Cyprus from China, Hong Kong or Macau, you will need to present a negative COVID-19 result (antigen or PCR) taken within the 48 hours before departure.  You may also be subject to random testing at the airport. Cyprus encourages all visitors to wear masks in high-risk settings such as long-haul flights. A 'SafePass' and a face mask are required to access some services such as aged care and medical facilities. If asked to present your Australian International COVID-19 Vaccination Certificate (ICVC) it must be presented in hard copy along with your photo identification. If you arrive with, or contract COVID-19 while in Cyprus, you'll be transferred to a quarantine facility (see 'Travel').\n\nWe advise:\nExercise a high degree of caution in Cyprus due to the active UN peacekeeping operation in the country.",
