            "advice":
                "You're no longer required to undertake a pre-departure COVID-19 test if you arrive in Australia from Hong Kong. Cannabidiol (CBD) is listed as a dangerous drug in Hong Kong (see 'Local laws'). The maximum penalty is life imprisonment. You no longer need proof of a negative COVID-19 test to board your flight to Hong Kong, however your temperature will be checked on arrival and you will be referred to local health authorities if you have COVID-19 symptoms. Dual citizenship is no longer recognised in the Hong Kong Special Administrative Region following the application of the Nationality Law of the People's Republic of China (see 'Local laws'). As previously advised, Hong Kong's National Security Law could be interpreted broadly, and you could break the law without intending to. If you're concerned about the new law, reconsider your need to remain in Hong Kong (see 'Local laws').\n\nWe advise:\nExercise a high degree of caution in Hong Kong due to ongoing local COVID-19 restrictions.",
