            "advice":
                "Cyclone Yaku is causing flooding, landslides and heavy rains, particularly in the coastal regions from Tumbes to Lima. Due to the weather conditions, a State of Emergency has been imposed in parts of Peru. This may disrupt travel services, including inter-provincial road travel. Some tourist attractions may be temporarily closed.\n\r\n\r\nCivil unrest is still occurring in some regions. Due to civil unrest and protests, a State of Emergency and local curfews remain in place in parts of Peru. We advise you reconsider your need to travel to Cusco, Puno, Arequipa, Ayacucho, Apurimac and the city of Puerto Maldonado. Other levels apply. There are widespread roadblocks and disruptions to land transport. If you plan to travel by road, research your route carefully, including regularly checking the official list of road closures. Take precautions to ensure your safety. Avoid areas with protests and leave if it's safe to. Follow the advice of local authorities. Contact your airline or travel provider for updates.\n\nWe advise:\nExercise a high degree of caution in Peru overall due to the high risk of violent crime.\nHigher levels apply in some areas.",
