            "advice":
                "We continue to advise you do not travel to Ukraine due to the volatile security environment and military conflict. If you're currently in Ukraine, we urge you to depart if it's safe to do so.\n\r\n\r\nDo not enter into new surrogacy arrangements. Due to the Russian invasion, the security situation continues to be volatile and could deteriorate suddenly. You'll need to travel to the nearest Australian Embassy or Consulate, at your own expense, to obtain a travel document for your child. The Australian Embassy in Kyiv remains temporarily closed.\n\r\n\r\nThe Russian invasion of Ukraine is ongoing. The security situation continues to be volatile. Heavy fighting is occurring in parts of eastern and southern Ukraine. Missile strikes and attacks are ongoing in some locations across the country, including in major cities. There have been many casualties. Foreigners have been killed and may be targeted. Do not travel to Ukraine. There is a risk to life.\n\r\n \n\r\nIf you're in Ukraine, be aware of your surroundings, review your personal security plans and monitor media for information about changing security conditions and alerts to shelter in place. Carefully consider the safest means and route to depart. You're responsible for your own safety and that of your family. Follow the advice of local Ukrainian authorities.\n\r\n\r\nOur ability to provide consular assistance in Ukraine is severely limited. The Australian Government will not be able to evacuate you from Ukraine. If you have significant concerns for your welfare, or that of another Australian, contact the Consular Emergency Centre on 1300 555 135 in Australia or +61 2 6261 3305 outside Australia.\n\r\n \n\r\nIf you're in Ukraine, register with the Department of Foreign Affairs and Trade's registration portal for Australian citizens in Ukraine ‚Äì see the 'Safety' section for details on how to register. Keep your registration details up to date in case we need to contact you.\n\nWe continue to advise:\nDo not travel to Ukraine due to the volatile security environment and military conflict.",
