            "advice":
                "We continue to advise do not travel to Myanmar due to ongoing civil unrest and armed conflict. Violence, including explosions and attacks, can occur anywhere and anytime, including in Yangon. Attacks may be planned against locations that are frequented by foreigners, which could include the Shangri-La and Lotte hotel and serviced apartments in Yangon, and restaurants and hotels in Nay Pyi Taw. Attacks are unpredictable in their location and intensity. The main targets have been infrastructure, police and military vehicles, and security and administrative personnel. Targets may also include other civilian infrastructure, including hotels, serviced apartments, restaurants, bars, shopping malls, schools, petrol stations and supermarkets. Heightened security arrangements are in place for Australian officials. Remain aware of the security environment at all times. Exercise caution including in townships under martial law. Minimise movement, especially on anniversaries and days of national significance and monitor media closely. Avoid all public gatherings, protests and areas of known and possible unrest. A curfew remains in place. There have been widespread detentions, including of foreigners.  may be at risk of arbitrary detention.\n\nWe continue to advise:\nDo not travel to Myanmar due to ongoing civil unrest and armed conflict.",
