            "advice":
                "Nigeria's State Assembly and Governor elections have been postponed from 11 March to 18 March. The risk of election related violence is high. You should avoid all political gatherings and election related sites in the lead up to, during and after this period. Travel by motor vehicle on election day is restricted. Restrictions may be imposed at short notice. Follow the instructions of local authorities. \n\r\n\r\nThere have been cash and petrol shortages across Nigeria in recent weeks. Trading, business and travel have been disrupted as a result. There have been hour-long queues at ATMs, banks and petrol stations. Several instances of heightened tensions have been reported. You should exercise caution and avoid large groups at these locations. Maintain stocks of essential supplies. We continue to advise 'reconsider your need to travel' to Nigeria overall. Higher levels apply in some areas. \n\nWe advise:\nReconsider your need to travel to Nigeria overall due to high threats of terrorist attack and kidnapping, the volatile security situation, possible violent civil unrest and high levels of violent crime.\nHigher levels apply.",
