            "advice":
                "The situation in Afghanistan remains highly volatile. We continue to advise against all travel to and within Afghanistan. There continues to be an ongoing and very high threat of terrorist attack throughout Afghanistan, including in Kabul and at land border crossings. Travel throughout Afghanistan is extremely dangerous. Violent incidents occur across the country. Aid and humanitarian workers are not safe from harassment, the threat of terrorism or kidnapping. Terrorists continue to target NGO and humanitarian operations across the country and within Kabul. Convoys have also been targeted. Land borders may close to travellers seeking to cross from Afghanistan. You need to carefully consider the risks should you attempt to leave by any route. The Australian Government can't offer advice on the safety of travelling to departure points. Any travel options you pursue are taken at your own risk. You‚Äôre responsible for your own safety and that of your family. Make sure your accommodation is secure and regularly review your personal security plans. Take all extra precautions for your safety. Make contingency plans to leave when it‚Äôs safe to do so. Foreign nationals, including , have been detained without due process. Reasons for detention may be unclear. The Australian Government may not be notified about a detention, and our ability to access information about a detainee or assist them is severely limited. Our ability to provide consular assistance to Australians in Afghanistan is severely limited.\n\nWe continue to advise:\nDo not travel to Afghanistan due to the extremely dangerous security situation and the very high threat of terrorist attack.",
