            "adviceLevel": 5,
            "adviceDate": "2023-01-11T23:00:00Z",
            "advice":
                "Do not travel to Russia due to the security environment and the impacts of the Russian invasion of Ukraine.\n\r\n \n\r\nTerrorists are very likely to try to carry out attacks in Russia. Terrorist groups, including al-Qaeda and Daesh-aligned groups, continue to call for attacks in Russia. Attacks can be indiscriminate and may occur on or around seasonal, festive, or religious events in public places and could include popular tourist sites. Russia has seen a number of terrorist attacks which have caused large casualty numbers, including in Moscow and St Petersburg, and Russia's aviation has also been targeted. Attacks may occur with little or no warning.\n\r\n\r\nThe security situation could deteriorate further with little warning. Security incidents often occur in the regions of Russia bordering Ukraine, including explosions and large fires. Do not attempt to travel to the Russia-Ukraine border or cross into Ukraine from Russia. \n\r\n\r\nRussian authorities may adopt a more negative attitude towards foreigners in Russia and enforce local laws in an arbitrary manner. Avoid any protests or demonstrations and avoid commenting publicly on political developments.\n\r\n \n\r\nRussia has introduced a 'medium response level' and a 'heightened preparedness' level in several regions. A basic readiness level is in place in the rest of Russia. There may be an increase in security personnel and installations. A range of security measures or restrictions may be introduced with little to no notice.\n\r\n\r\nIf you're in Russia, leave immediately using the limited commercial options available or private means if it's safe to do so. Review your personal security plans and carefully consider the safest means and route to depart. You're responsible for your own safety and that of your family. Make sure your travel documents are up to date. If, despite our advice, you decide to enter Russia, expect thorough security checks at the border, including questioning and inspections of electronic devices.\n\r\n \n\r\nOur ability to provide consular assistance in Russia is limited. The Australian Government will not be able to evacuate you from Russia. If you have significant concerns for your welfare, or that of another Australian, contact the Consular Emergency Centre on 1300 555 135 in Australia or +61 2 6261 3305 outside Australia. If you're in Russia, register with the Department of Foreign Affairs and Trade's registration portal for Australian citizens in Russia ‚Äì see the 'Safety' section for details on how to register.\n\nWe continue to advise:\nDo not travel to Russia due to the security environment and the impacts of the military conflict with Ukraine.",
            "adviceDescription": "Do not travel",
            "detailedAdvice": "",
