                "Sudan's political situation remains unstable despite the framework agreement signed between the military and civilian parties on 5 December. Large scale protests continue to take place across the country. There's reports of violence against protestors, including arbitrary arrests and deaths. Avoid all demonstrations and remain vigilant. Khartoum International Airport is open, however commercial flights may be limited. Internet and mobile services remain unreliable. You should limit your movements and avoid non-essential travel. Monitor media coverage and follow the advice of local authorities (see 'Safety').\n\nWe advise:\nReconsider your need to travel to Sudan overall due to ongoing civil unrest and the threat of terrorist attack.",
