            "advice":
                "On 6 February, a 7.8 magnitude earthquake occurred in southern T√ºrkiye, which also severely affected northern Syria, including Aleppo and Idlib. There are significant numbers of casualties and extensive damage to infrastructure including roads, telecommunications and electricity supply. Further aftershocks could occur. If you're in the area, you should leave. Monitor local media for advice and follow directions of local authorities. Contact your friends and family as soon as possible to let them know you're safe. If you have significant concerns for your welfare, or that of another Australian, contact the Consular Emergency Centre on 1300 555 135 in Australia or +61 2 6261 3305 outside Australia. \n\r\n\r\nEntry and exit measures for Syria may change without notice. You don't need a negative COVID-19 test result or proof of vaccination to enter.  If you‚Äôre planning to cross to Lebanon, contact Lebanese authorities for requirements. The security situation remains extremely volatile. If you're in Syria, leave as soon as possible.\n\nWe advise:\nDo not travel to Syria due to the extremely dangerous security situation. Armed conflict is ongoing and air strikes, kidnappings and terrorist attacks are common.",
